import React from 'react';

interface HumanApprovalProps {
  onApprove: () => void;
  onReject: () => void;
}

const HumanApproval: React.FC<HumanApprovalProps> = ({ onApprove, onReject }) => {
  return (
    <div className="card border-t-2 border-neutral-light">
      <h3 className="text-xl font-semibold mb-4">Human Approval</h3>

      <div className="mb-4">
        <p className="text-neutral-dark">
          Please review the AI's analysis and decide if you want to approve or reject this task.
        </p>
      </div>

      <div className="flex flex-wrap gap-4">
        <button
          className="btn btn-primary flex items-center"
          onClick={onApprove}
          type="button"
        >
          <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 mr-2" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M5 13l4 4L19 7" />
          </svg>
          Approve
        </button>

        <button
          className="btn btn-outline flex items-center"
          onClick={onReject}
          type="button"
        >
          <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 mr-2" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" />
          </svg>
          Reject
        </button>
      </div>
    </div>
  );
};

export default HumanApproval;
